import { StyleSheet, Text, TextInput , TouchableOpacity, View } from 'react-native'
import Checkbox from "expo-checkbox";
import { useState } from "react";
import React from 'react'

const  Contact = ({ navigation }) => {
  const [userName, setUserName] = useState(""); 
  const [email, setEmail] = useState("");
  const [userNumber, setNumber] = useState("");
  const [messageBox, setMessageBox] = useState("");

  const Submit = () => {
 if (userName === "TopG" && email === "1534") {
      // console.log(` WellCome  ${userName} `)
      navigation.navigate("home", { myName: `${userName}` });
    } else {
      console.log(`Wrong userName or PassWord`);
    }
  };

  // console.log(userName)
  // console.log(userPassword)
  const [agree, setAgree] = useState(false);   
  return (
    <View style={Styles.mainContainer}>
      <View style={Styles.TextContainer}>
        <Text style={Styles.LoginHeading}>Level Up your Knowledge</Text>
        <Text style={Styles.LoginText}>
          You can reach us anytime malik@top-g.com
        </Text>
      </View>
      <View style={Styles.NameContainer}>
        <Text style={Styles.NameText}> Enter your name </Text>
        <TextInput
          style={Styles.NameInput}
          autoCapitalize="none"
          autoCorrect={false}
          value={userName} // its is main prop
          onChangeText={(name) => {   // this is control component because this value i  handle by react useState hook 
            setUserName(name);
          }}
        />
      </View>
      <View style={Styles.PasswordContainer}>
        <Text style={Styles.PasswordText}> Enter your password </Text>
        <TextInput
          style={Styles.PasswordInput}
          autoCapitalize="none"
          autoCorrect={false}
          secureTextEntry={true}
          value={email}
          onChangeText={(password) => {
            setEmail(password);
          }}
        />
      </View>
      <View  style={Styles.PasswordContainer}>
        <Text style={Styles.PasswordText}> Enter your  Phone number </Text>
        <TextInput
          style={Styles.PasswordInput}
          autoCapitalize="none"
          autoCorrect={false}
          // secureTextEntry={true}
          value={userNumber}
          onChangeText={(num) => {
            setNumber(num);
          }}
        />
      </View>
      <View  style={Styles.PasswordContainer}>
        <Text style={Styles.PasswordText}>  How can i help You </Text>
        <TextInput
          style={Styles.PasswordInput}
          autoCapitalize="none"
        numberOfLines={8}
          value={messageBox}
          onChangeText={(message) => {
            setMessageBox(message);
          }}
        />
      </View>
      <View style={Styles.CheckboxContainer}>
        <Checkbox
          value={agree}
          onValueChange={() => {
            setAgree(!agree);
          }}
          color={agree ? "#03A9F5" : undefined}
          style={Styles.Checkbox}
        />
        <Text style={Styles.CheckboxText}>
          i have read and agrees with the TC
        </Text>
      </View>
      <TouchableOpacity
        // disabled= {agree ? false : true}
        disabled={!agree}
        style={[agree ? Styles.LoginButton : Styles.LoginBtnWTColor]}
        onPress={() => {
          Submit();
        }}
      >
        <Text
          style={[agree ? Styles.LoginBtnText : Styles.LoginBtnWTcolorText]}
        >
          Login
        </Text>
      </TouchableOpacity>
    </View>
  );
};

const Styles = StyleSheet.create({
  mainContainer: {  
    marginLeft:100, 
    height: 600,
    width: "70%",
    marginTop: "12px",
    backgroundColor:"yellow"
  },
  TextContainer: {
    height: 100,
    // backgroundColor:'yellow',
    width: "100%",
  },
  LoginHeading: {
    fontWeight: "700",
    fontSize: 35,
    fontFamily: "bold",
  },
  LoginText: {
    fontFamily: "bold",
    fontSize: 15,
    marginTop: "7px",
    fontFamily: 'OpenSans_300Light_Italic',
  },
  NameContainer: {
    height: 70,
    // backgroundColor:'pink',
    width: "100%",
    marginTop: "22px",
  },
  NameText: {
    fontWeight: "400",
    fontSize: 20,
    fontFamily: "bold",
    fontFamily: 'OpenSans_500Medium ',
  },
  NameInput: {
    height: 30,
    width: "100%",
    borderColor: "black",
    borderWidth: 2,
    borderRadius: 2,
    marginTop: 3,
  },
  PasswordContainer: {
    height: 70,
    // backgroundColor:'coral',
    width: "100%",
  },
  PasswordText: {
    fontWeight: "400",
    fontSize: 20,
    fontFamily: "bold",
    fontFamily: "OpenSans_500Medium ",
  },
  PasswordInput: {
    height: 30,
    width: "100%",
    // borderColor: "black",
    borderWidth: 2,
    borderRadius: 2,
    marginTop: 3,
  },
  CheckboxContainer: {
    height: 40,
    // backgroundColor:'#A8D1DF',
    width: "100%",
    flexDirection: "row", // Display children in a row
    alignItems: "center", // Vertically center the children
  },
  Checkbox: {
    marginRight: "5px",
  },
  CheckboxText: {
    fontWeight: "300",
    fontSize: 15,
    fontFamily: "bold",
    color: "#62666B",
   
  },
  LoginBtnWTColor: {
    height: 30,
    width: 200,
    borderWidth: 2,
    borderColor: "black",
    borderRadius: 2,
    backgroundColor: "#E3E4E6",
    display: "flex",
    justifyContent: "center",
    width: "100%",
    alignSelf: "center",
  },
  LoginButton: {
    height: 30,
    width: "100%",
    backgroundColor: "#03A9F5",
    borderRadius: 2,

    display: "flex",
    justifyContent: "center",
    alignSelf: "center",
  },
  LoginBtnText: {
    color: "white",
    display: "flex",
    justifyContent: "center",
    fontWeight: "500",
    fontSize: "large",
    fontFamily:'OpenSans_400Regular',  
  },
  LoginBtnWTcolorText: {
    color: "black",
    display: "flex",
    justifyContent: "center",
    fontWeight: "500",
    fontSize: "large",
    fontFamily:'OpenSans_400Regular',  
  },
});
export default Contact
